func TestRun_bash(t *testing.T) {
	testCases := []struct {
		input Input
		want  *box.Result
	}{
		{
			Input{
				Lang:  "bash",
				Files: []box.File{{Body: `echo hello`}},
			},
			&box.Result{
				Logs: []box.Log{{Stream: 1, Log: "hello"}},
				CPU:  9461,
				MEM:  560,
				Time: 143,
			},
		},
		{
			Input{
				Lang:  "bash",
				Files: []box.File{{Body: `echo hello; echo world`}},
			},
			&box.Result{
				Logs: []box.Log{
					{Stream: 1, Log: "hello"},
					{Stream: 1, Log: "world"},
				},
				CPU:  8935,
				MEM:  564,
				Time: 192,
			},
		},
		{
			Input{
				Lang:  "bash",
				Files: []box.File{{Body: `echo hello; echo; echo world; echo`}},
			},
			&box.Result{
				Logs: []box.Log{
					{Stream: 1, Log: "hello"},
					{Stream: 1, Log: ""},
					{Stream: 1, Log: "world"},
					{Stream: 1, Log: ""},
				},
				CPU:  9512,
				MEM:  568,
				Time: 192,
			},
		},
		{
			Input{
				Lang:  "bash",
				Files: []box.File{{Body: `echo hello 1>&2; echo world 1>&2`}},
			},
			&box.Result{
				Logs: []box.Log{
					{Stream: 2, Log: "hello"},
					{Stream: 2, Log: "world"},
				},
				CPU:  9052,
				MEM:  548,
				Time: 16,
			},
		},
	}
	for i, tc := range testCases {
		t.Run(testutil.Name(i, tc.input), func(t *testing.T) {
			got, err := lang1.Run(tc.input)
			require.NoError(t, err)
			equalResult(t, tc.want, got)
		})
	}
}

